def auth(consumer_key, consumer_secret, access_token, access_token_secret, account_ID):
	# initialize the client
	client = Client(CONSUMER_KEY, CONSUMER_SECRET, ACCESS_TOKEN, ACCESS_TOKEN_SECRET)
	# load the advertiser account instance
	account = client.accounts(ACCOUNT_ID)
	return account

def create_campaign(account):
	# create your campaign
	campaign = Campaign(account)
	campaign.funding_instrument_id = account.funding_instruments().next().id
	campaign.daily_budget_amount_local_micro = 100000000
	print('Please input a campaign name: ')
	campaign.name = input()
	campaign.entity_status = ENTITY_STATUS.PAUSED
	campaign.start_time = datetime.utcnow()
	campaign.save()
	return campaign.id

def create_lineitem(campaign_id, account):
	# create a line item for the campaign
	line_item = LineItem(account)
	line_item.campaign_id = campaign_id
	print('Please input a line item name: ')
	line_item.name = input()
	line_item.product_type = PRODUCT.PROMOTED_TWEETS
	line_item.placements = [PLACEMENT.ALL_ON_TWITTER]
	line_item.objective = OBJECTIVE.ENGAGEMENTS
	line_item.bid_amount_local_micro = 1000000
	line_item.entity_status = ENTITY_STATUS.PAUSED
	line_item.save()
	return line_item.id

#1. City search.
def city_search():
	print('Please input the city name you want to target, either in Kanji or Romaji:')
	city_name = input()
	result = []
	for i in city_dict_JP.keys():
		if i.upper().find(city_name.upper()) != -1:
			result.append(i)
	for j in range(len(result)):
		print(str(j+1) + "." + result[j])

	print('Please input the number of the city above:')
	number = input()
	target_city = city_dict_JP[result[int(number) - 1]]
	return target_city

def city_search_name(city_name):
	result = []
	for i in city_dict_JP.keys():
		if i.upper().find(city_name.upper()) != -1:
			result.append(i)
	for j in range(len(result)):
		print(str(j+1) + "." + result[j])
	print('Please input the number of the city above:')
	number = input()
	target_city = result[int(number) - 1]
	target_city_value = city_dict_JP[result[int(number) - 1]]
	return target_city, target_city_value

#2. Package targeting
def create_ctpackage():
	print('Please input how many cities you want to target, with user reach descheding: ')
	num = input()
	city_list = top_city_JP[:num]
	return city_list

#3. Creating tweets using different targeting cities names.
def create_tweets(account, city_name):
	user_id = UserIdLookup.load(account, screen_name='BowenJAPAC').id
	text = "sample text for " + city_name + " city."
	tweet = Tweet.create(account, text=text, as_user_id=user_id)
	return tweet['id']

# add targeting criteria
def create_targeting(account, line_item_id, city_taregting_value):
	targeting_criteria = TargetingCriteria(account)
	targeting_criteria.line_item_id = line_item_id
	targeting_criteria.targeting_type = 'LOCATION'
#	print('Please input the CITY targeting value: ')
	targeting_criteria.targeting_value = city_taregting_value
	targeting_criteria.operator_type = "EQ"
	targeting_criteria.save()


def main():
	account = auth(CONSUMER_KEY, CONSUMER_SECRET, ACCESS_TOKEN, ACCESS_TOKEN_SECRET, ACCOUNT_ID)
	campaign_id = "fi2nb" #create_campaign(account)
	print('Do you want to create a city package targeting?Like target the 10 most populated cities at once. yes or no?')
	answer = input()
	if answer == 'yes':
		line_item_id = create_lineitem(campaign_id, account)
		city_list = create_ctpackage()
		for i in city_list:
			create_targeting(account, line_item_id, i)
	else:
		print('Do you want to target differnt cities in different line_items with differnt tweets? To get granular targeting. yes or no?')
		answer = input()
		if answer == 'yes':
			city_list = []
			city_value_list = []
			while True:
				print("Please input city name. End with 'no'.")
				ans = input()
				if ans != 'no':
					ctname, ctvalue = city_search_name(ans)
					city_list.append(ctname)
					city_value_list.append(ctvalue)
					print(city_list)
					print(city_value_list)
				if ans == 'no':
					break
			for i in range(len(city_list)):
				tweet_id = create_tweets(account, city_list[i])
